import Card from "./Card.js";
import Transition from "react-transition-group/Transition";

const Cards = (props) => {
  return (
    <>
      {props.songs.map((song) => (
        <>
          {song.visible && (
            <Card
              id={song.id}
              name={song.name}
              artist={song.artist}
              chords={song.chords}
              youtube={song.youtube}
              status={song.status}
              lyrics={song.lyrics}
              toggle={props.toggle}
            />
          )}
        </>
      ))}
    </>
  );
};

export default Cards;
